import avatar from './DonkeyKong.png';

function Logo(props){
  const userPic = <img src={avatar}/>;
  return userPic;
}

function App() {
  return (
    <div>
      <h1>Hello</h1>
      <Logo/>
    </div>
  )
}

export default App;
